import React from "react";
import { FaBars, FaTimes } from "react-icons/fa";
import "./Navbar.css"

const Navbar = ({ onScrollToSection }) => {
  const [isMobile, setIsMobile] = React.useState(false);

  const toggleMobileMenu = () => {
    setIsMobile(!isMobile);
  };

  return (
    <div className="navbar">
      <div className="navbar-logo">
        <h1>Vaibhav</h1>
      </div>
      <ul className={`navbar-links ${isMobile ? "active" : ""}`}>
        <li>
          <button onClick={() => onScrollToSection("home")}>Home</button>
        </li>
        <li>
          <button onClick={() => onScrollToSection("gallery")}>Gallery</button>
        </li>
        <li>
          <button onClick={() => onScrollToSection("projects")}>Projects</button>
        </li>
        <li>
          <button onClick={() => onScrollToSection("resume")}>Resume</button>
        </li>
        <li>
          <button onClick={() => onScrollToSection("contact")}>Contact</button>
        </li>
      </ul>
      <div className="mobile-menu-icon" onClick={toggleMobileMenu}>
        {isMobile ? <FaTimes /> : <FaBars />}
      </div>
    </div>
  );
};

export default Navbar;
